import React,{createContext,useState} from 'react';
export const MovieContext=React.createContext();


export default function MovieProvider(props){

    const [movies,setmovies]=useState([{tempe:'38',humour:'45',feelslike:'40',sheher:'E.g mumbai',unit:'Â°C',datetime:'21hq2nc'}]);
    
    //  3 default photos for every user
    const [plato,setplato]=useState([
        {location:'data:image/jpeg;base64,',key:'1'},
         {location:'data:image/jpeg;base64,',key:'2'},
         {location:'data:image/jpeg;base64,',key:'3'},

     ])

      const [photoid,setphtotid]=useState(0)

       const [check,setcheck]=useState(1)


    return(
        <MovieContext.Provider value={{value1:[movies,setmovies],value2:[plato,setplato],value3:[photoid,setphtotid],value4:[check,setcheck]}}>
            {props.children}
        </MovieContext.Provider>
    )
}
   
